import { useEffect } from 'react'

const { DeviceRequest, DeviceResponse } = require('./devicepb/device_pb.js')
const { DeviceServiceClient } = require('./devicepb/device_grpc_web_pb.js')

var client = new DeviceServiceClient('http://localhost:8000', null ,null)


const Device = (props: any) => {
  const { device } = props

  useEffect(() => {
    const request = new DeviceRequest()
    request.setDeviceId(device)

    client.GetDeviceStatus(request, {}, (err, response) => {
      if (response == nil) {
        console.log(err)
      } else {
        console.log(response.getStatus())
      }
    })
  },[])

  return (
    <div className="flex w-1/2 p-8 back rounded-full">
      <div className="w-1/3">
        <img src="/Setting.png" width="100"/>
      </div>
      <div className="flex flex-col gap-y-4">
          <span>
            {device}
          </span>
          <div className="flex items-center justify-between">
            <span className={`w-[30px] h-30px`}>
            </span>
          </div>
      </div>
    </div>
  )
}

export default Device
